    <div className="modal-body">
      Name :{" "}
      <input
        type="text"
        value={nameInp}
        onChange={(e) => setNameInp(e.target.value)}
      ></input>
      Age :{" "}
      <input
        type="text"
        value={ageInp}
        onChange={(e) => setAgeInp(e.target.value)}
      ></input>
    </div>
  );
}

export default Body;
